import { createSelector } from 'reselect';

const getIsLoggedIn = (state) => state.auth;
const getRole = (state) => state.role;

export const getIsLoggedInMemoized = createSelector(
  getIsLoggedIn,
  (isLoggedIn) => isLoggedIn
);
